troTitle:"What is this?",intro1:"It's similar to Google's Dialogflow, but with an additional canvas for editing processes. It's also similar to Typebot, but it includes a full answering backend.",intro2:"It has a feature called flow canvas that allows you to visually edit a conversation flow, test it, and finally publish it to the public.",intro3:"Currently, it can return discourse to the user and capture user input, and can also execute different nodes through conditional judgment .",intro4:"It is very small. The entire software, including front-end and back-end, is less than 6M in size, very easy to distribute and deploy.",intro5:"You can modify the listening port of the software so that you can run multiple instances on the same server at the same time to handle different user scenarios.",intro6:"Once it is downloaded, it can be used directly without installing any dependencies. And the data is stored locally, which can protect the data camp privacy.",midTitle:"Advantages",adv1Title:"Easy to use",adv1:"Simple and intuitive.<br />Everybody can use it<br />Just few drag drop and clicks<br />A dialog flow can then be mapped out",demo:"Try Demos",demo1:"Notification of loan repayment",demo2:"Information collection",demo3:"Notification",demoUnvailableTitle:"Demos are not available on Github",demoUnvailableContent:'Since there is currently no server to host the backend.<br />But you can <a href="https://github.com/dialogflowchatbot/dialogflow/releases">download</a> this software and try these 3 demonstration dialog flows',adv2Title:"Tiny fast and portable",adv2:"Only ONE executable file (database is generated automatically)<br />pretty easy for deployment<br />Relying on AoT compilation technology<br />Program provides high concurrency and blazingly fast responses",adv3Title:"Deal with various issues",adv3:"Use different combinations of flow nodes<br />Meet the business requirements of different scenarios<br />Solve problems encountered by different groups of people",a